import React from "react";
// import { produce } from "immer";
import { getFundMNRank } from "../service";

class FundOrder extends React.Component {
  constructor() {
    super();
    this.state = {
      fundlist: [],
    };
  }

  render() {
    return <div>基金排行</div>;
  }
  componentDidMount() {
    getFundMNRank()
      .then((res) => {
        // console.log(res);
        this.setState({ fundlist: res.data });
      })
      .catch((err) => console.log(err));
  }
}
export default FundOrder;
